import React from "react";
import {Firstname} from "./App";

const Comp3 = () =>{
return (
    <>
    <Firstname.Consumer>
        {(fname)=>{
            return (
                <h1>{fname}</h1>
            )
        }}
    </Firstname.Consumer>
    </>
)
}


export default Comp3;
